		// bu b繹lgesinden her iki state dilimini de "g繹rebilmemiz"dir.
	};

	const stil = {
		fontSize: "1.5em",
		marginTop: "0.5em",
		color: "royalblue", //  kutlarken renk gold'a d繹necek
	};

	return (
		<div className="widget-programmers container">
			<h2>Programc覺lar</h2>
			<div className="programmers">
				{
					/* K繹t羹 bug! 'enIyilerListesi' yerine bir state dilimini maplemeliyiz.
          // 繹yle diyebiliriz: "aa bu 癟al覺覺yor!" Ama programcilar bir state diliminden gelmiyorsa,
          // asla yeni programci ekleyemeyiz, programcilari d羹zenleyemeyiz ya da silemeyiz. D羹zeltin!
          " */
